sys_variable_value.value:
(function execute(inputs, outputs) {

if (inputs.step_input_status_code == '200')  {
 
    var responseObj = JSON.parse(inputs.step_input_response_body);
   
    outputs.step_output_title = responseObj.result.title;
    outputs.step_output_authors = responseObj.result.authors;
    outputs.step_output_genre = responseObj.result.genre;
    outputs.step_output_language = responseObj.result.language;
}
  
})(inputs, outputs);

